import React from 'react'
import Sidebar from './Sidebar'
import Content from './Content'
import {
  BrowserRouter as Router,
  Switch, Route, Link
} from 'react-router-dom'

const Dashboard = () => {
  const dashStyle = {
    display: 'flex',
    alignItems: 'stretch',
    minHeight: '100vh',
  }

  return (
    <div style={dashStyle}>
      <Sidebar />
      <Content />
    </div>
  )
}

export default Dashboard
